import React from 'react';
import './AnimationSpeed.css'

const AnimationSpeed = (props)=>{
    return(
        <select className='AnimationSpeed'
        value={props.initual} onChange={props.changed} >
            <option className = "border: 2px solid red;
  border-radius: 25px;" value="1">0.5</option>
            <option className = "border: 2px solid red;
  border-radius: 25px;" value="0.5">1</option>
            <option className = "border: 2px solid red;
  border-radius: 25px;" value="2">0.25</option>
            <option  className = "border: 2px solid red;
  border-radius: 25px;"value="0.25">2</option>
        </select>
    )
}
export default AnimationSpeed;
